import React, { useState, useEffect } from 'react';
import "../Pages/Admin.css";

function AddProduct({ product, onClose }) {
    const [productName, setProductName] = useState('');
    const [brand, setBrand] = useState('');
    const [category, setCategory] = useState('All');
    const [subCategory, setSubCategory] = useState('');
    const [specification, setSpecification] = useState('');
    const [unit, setUnit] = useState('pcs');
    const [tags, setTags] = useState('');
    const [description, setDescription] = useState('');
    const [price, setPrice] = useState('');
    const [compare, setCompare] = useState('');
    const [discount, setDiscount] = useState('');
    const [thumbnail, setThumbnail] = useState('');
    const [imgone, setImgOne] = useState('');
    const [imgtwo, setImgTwo] = useState('');
    const [imgthree, setImgThree] = useState('');
    const [rate, setRate] = useState(3.5);

    useEffect(() => {
        if (product) {
            // Populate fields if product is passed
            setProductName(product.name);
            setBrand(product.brand);
            setCategory(product.category);
            setSubCategory(product.subCategory);
            setSpecification(product.specification);
            setUnit(product.unit);
            setTags(product.tags);
            setDescription(product.description);
            setPrice(product.price);
            setCompare(product.compare);
            setDiscount(product.discount);
            setThumbnail(product.thumbnail);
            setImgOne(product.imgone);
            setImgTwo(product.imgtwo);
            setImgThree(product.imgthree);
            setRate(product.rate);
        }
    }, [product]);

    function submit(e) {
        e.preventDefault();
        const productData = { productName, brand, category, subCategory, specification, unit, tags, description, price, compare, discount, thumbnail, imgone, imgtwo, imgthree, rate };

        if (product) {
            // If editing, send PUT request
            fetch(`http://localhost:5006/products/${product.id}`, {
                method: 'PUT',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(productData),
            })
                .then((response) => response.json())
                .then(() => {
                    console.log('Product updated');
                    onClose(); // Close the form after submission
                })
                .catch((error) => {
                    console.error('Error:', error);
                });
        } else {
            // If adding, send POST request
            fetch('http://localhost:5006/products', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(productData),
            })
                .then((response) => response.json())
                .then(() => {
                    console.log('Product added');
                    onClose(); // Close the form after submission
                })
                .catch((error) => {
                    console.error('Error:', error);
                });
        }
    }

    return (
        <main className="addProductMain">
            <form onSubmit={submit}>
                <table className='addProductsMainTable'>
                    <thead>
                        <tr>
                            <th colSpan="2"><h1>Product Information</h1></th>
                            <th><button type="button" onClick={onClose}>Close</button></th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><label htmlFor="">Product Name</label></td>
                            <td><input type="text" placeholder='Product Name' value={productName} onChange={(e) => setProductName(e.target.value)} /></td>
                        </tr>
                        {/* Other fields remain the same */}
                        {/* ... */}
                        <tr>
                            <td colSpan="2"><button type="submit" className='addSubmit'>Submit</button></td>
                        </tr>
                    </tbody>
                </table>
            </form>
        </main>
    );
}

export default AddProduct;
